import React, { useState, userEffect } from "react";
import { hydrateRoot } from "react-dom/client";

function App() {
  const [data, setData] = useState([{}])
  // Fetch the router;
  userEffect(() => {
    fetch(`api/reports/${data}`).then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
  return (
    <div>
      {(typeof data.article === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.article.map((items, i) => (
          <p key={i}>{items}</p>
        ))
      )}
    </div>
  )
}

export default App
